    "lpc-pronouns-ui.PronounsStrings.input.thirdSuggestion": "Hij/Hem",
    "lpc-pronouns-ui.PronounsStrings.learnMore.firstPageFirstParagraphText": "Voornaamwoorden zijn in deze context de woorden die we gebruiken om iemands naam in een zin te vervangen. Voornaamwoorden worden in veel talen afgesloten, net als de genderneutraal versie ervan. Dit veld is een optionele plaats waar u uw voornaamwoorden voor anderen kunt weergeven via uw profielkaart.",
    "lpc-pronouns-ui.PronounsStrings.learnMore.firstPageSecondParagraphText": " Het correct gebruiken van iemands voornaamwoorden is een eenvoudige manier om aan te tonen dat we het belangrijk vinden om inclusief en respectvol te zijn. Het delen van voornaamwoorden wanneer u uzelf introduceert of op uw profielkaart draagt bij aan het creëren van een inclusievere omgeving en moedigt meer mensen aan om hun eigen naam te delen.",
    "lpc-pronouns-ui.PronounsStrings.learnMore.firstPageTitle": "Voornaamwoorden in uw profiel",
    "lpc-pronouns-ui.PronounsStrings.learnMore.learnMoreAltText": "Afbeelding voor meer informatie",
    "lpc-pronouns-ui.PronounsStrings.learnMore.secondPageFirstParagraphText": "Voornaamwoorden maken deel uit van de identiteit van een persoon. Als het geslacht waarmee u zich identificeert overeenkomt met het geslacht dat bij de geboorte aan u is toegewezen, hebt u misschien nooit hoeven nadenken over welke voornaamwoorden mensen gebruiken als verwijzing naar u. Wanneer een onjuist voornaamwoord wordt gebruikt om naar iemand te verwijzen, kan het beledigend zijn, zowel opzettelijk als onbedoeld.",
    "lpc-pronouns-ui.PronounsStrings.learnMore.secondPageSecondParagraphText": "Probeer te voorkomen dat u gist welke voornaamwoorden iemand gebruikt op basis van de naam of de eerste waarnemingen van de persoon. Als u het niet zeker weet, vraagt of gebruikt u zijn of haar naam.",
    "lpc-pronouns-ui.PronounsStrings.learnMore.secondPageTitle": "Hypothesen vermijden",
